import React from 'react';
import './Climb.css';
import ClimbInstance from '../ClimbInstance/ClimbInstance';



const Climbs = (props) => {

    const addLike = (climbToUpdate) => {
      props.addLike(climbToUpdate);
    }

    const addComment = (climbToUpdate, comment) => {
      props.addComment(climbToUpdate, comment);
    }

    return props.climbList.map((climb, index) => (
      <ClimbInstance climb={climb} handleLikeClick={addLike} handleCommentClick={addComment} />

      ));



};

export default Climbs;
